	public:

		TEST_METHOD(Native_FindApproximateMatches_AtStart)
		{
			vector<size_t> matches = findApproximateMatches(
				"ATTCTGGA",
				"ATTCTGGATCCAGAACGC",
				1);
			Assert::AreEqual(std::string("0"), concatenate(matches));
		}

		TEST_METHOD(Native_FindApproximateMatches_AtEnd)
		{
			vector<size_t> matches = findApproximateMatches(
				"ATTCTGGA",
				"AATCAAATATTCTGGA",
				1);
			Assert::AreEqual(std::string("8"), concatenate(matches));
		}

		TEST_METHOD(Native_FindApproximateMatches_Short)
		{
			vector<size_t> matches = findApproximateMatches(
				"ATTCTGGA",
				"CGCCCGAATCCAGAACGCATTCCCATATTTCGGGACCACTGGCCTCCACGGTACGGACGTCAATCAAAT",
				3);
			Assert::AreEqual(std::string("6 7 26 27"), concatenate(matches));
		}

